const postersPerPage = 54;
let currentPage = 1;
let searchQuery = '';
let selectedCategory = 'all';
let filteredPosters = allPosters;

function filterPosters(query, category) {
  filteredPosters = allPosters.filter(poster => {
    const matchesQuery = poster.title.toLowerCase().includes(query.toLowerCase());
    const matchesCategory = category === 'all' || poster.category === category;
    return matchesQuery && matchesCategory;
  });
  currentPage = 1;
  renderGrid(currentPage);
}

function renderGrid(page) {
  const grid = document.getElementById('grid');
  grid.innerHTML = '';
  const start = (page - 1) * postersPerPage;
  const end = start + postersPerPage;
  const paginatedPosters = filteredPosters.slice(start, end);

  paginatedPosters.forEach(item => {
    const card = document.createElement('article');
    card.className = 'card';
    if (item.id === 500) card.classList.add('highlight');

    const posterSrc = encodeURI(item.poster);
    const logoSrc = encodeURI(item.logo);

    let ratingClass = 'rating-' + (item.rating ? item.rating.toLowerCase() : 'l');

    let sponsoredHtml = '';
    if (item.sponsored) {
      sponsoredHtml = '<div class="sponsored">Patrocinado</div>';
    }

    card.innerHTML = `
      <span class="rating ${ratingClass}">${item.rating || 'L'}</span>
      <img class="poster" src="${posterSrc}" alt="${escapeHtml(item.title)}"
           loading="lazy" onerror="this.onerror=null; this.src='assets/posters/placeholder.jpg'">
      <div class="overlay">
        <div class="logo-wrap">
          <img src="${logoSrc}" alt="logo ${escapeHtml(item.title)}"
               onerror="this.onerror=null; this.src='assets/logos/placeholder.png'">
          <div style="color:white;font-weight:600;font-size:13px">${escapeHtml(item.title)}</div>
        </div>
      </div>
      <div class="card-info">
        <div class="title">${escapeHtml(item.title)}</div>
        <div class="price">R$ ${item.price}</div>
      </div>
      ${sponsoredHtml}
    `;
    card.addEventListener('click', () => showPreview(item));
    grid.appendChild(card);
  });
  renderPagination();
}

function renderPagination() {
  const totalPages = Math.ceil(filteredPosters.length / postersPerPage);
  const pagination = document.getElementById('pagination');
  pagination.innerHTML = '';

  const maxPagesToShow = 5;
  let startPage = Math.max(1, currentPage - Math.floor(maxPagesToShow / 2));
  let endPage = Math.min(totalPages, startPage + maxPagesToShow - 1);
  if (endPage - startPage + 1 < maxPagesToShow) {
    startPage = Math.max(1, endPage - maxPagesToShow + 1);
  }

  const makeBtn = (label, disabled, onClick, active = false) => {
    const b = document.createElement('button');
    b.textContent = label;
    if (disabled) b.disabled = true;
    if (active) b.classList.add('active');
    b.addEventListener('click', onClick);
    return b;
  };

  pagination.appendChild(makeBtn('Primeira', currentPage === 1, () => { currentPage = 1; renderGrid(currentPage); }));
  pagination.appendChild(makeBtn('Anterior', currentPage === 1, () => { if (currentPage > 1) { currentPage--; renderGrid(currentPage); } }));

  for (let i = startPage; i <= endPage; i++) {
    pagination.appendChild(makeBtn(String(i), false, () => { currentPage = i; renderGrid(currentPage); }, i === currentPage));
  }

  pagination.appendChild(makeBtn('Próxima', currentPage === totalPages, () => { if (currentPage < totalPages) { currentPage++; renderGrid(currentPage); } }));
  pagination.appendChild(makeBtn('Última', currentPage === totalPages, () => { currentPage = totalPages; renderGrid(currentPage); }));
}

function escapeHtml(text) {
  if (!text) return '';
  return text.replace(/[&<>"']/g, m => ({ '&': '&amp;', '<': '&lt;', '>': '&gt;', '"': '&quot;', "'": '&#39;' }[m]));
}

function showPreview(item) {
  const preview = document.getElementById('preview');
  const sponsorSection = item.sponsored ? '' : '<a href="https://livepix.gg/tucoreage" class="sponsor-link">Patrocinar</a>';
  preview.innerHTML = `
    <button class="close-btn">✕</button>
    <h2>${escapeHtml(item.title)}</h2>
    <p>${escapeHtml(item.synopsis || 'Sinopse não disponível.')}</p>
    ${sponsorSection}
  `;
  const closeBtn = preview.querySelector('.close-btn');
  closeBtn.addEventListener('click', hidePreview);
  
  preview.style.display = 'block';
  if (item.wallpaper) {
    preview.style.backgroundImage = `url('${item.wallpaper}')`;
    preview.style.backgroundSize = 'cover';
    preview.style.backgroundPosition = 'center';
    preview.style.color = '#17dad6ff';
  } else {
    preview.style.backgroundImage = '';
    preview.style.color = '';
  }
}

function hidePreview() {
  const preview = document.getElementById('preview');
  preview.style.display = 'none';
  preview.innerHTML = '';
}

const searchInput = document.getElementById('searchInput');
searchInput.addEventListener('input', (e) => {
  searchQuery = e.target.value;
  filterPosters(searchQuery, selectedCategory);
});

const categoryButtons = document.querySelectorAll('.category-btn');
categoryButtons.forEach(button => {
  button.addEventListener('click', () => {
    categoryButtons.forEach(btn => btn.classList.remove('active'));
    button.classList.add('active');
    selectedCategory = button.dataset.category;
    filterPosters(searchQuery, selectedCategory);
  });
});

function renderPagination() {
  const totalPages = Math.ceil(filteredPosters.length / postersPerPage);
  const pagination = document.getElementById('pagination');
  pagination.innerHTML = '';

  const maxPagesToShow = 5;
  let startPage = Math.max(1, currentPage - Math.floor(maxPagesToShow / 2));
  let endPage = Math.min(totalPages, startPage + maxPagesToShow - 1);
  if (endPage - startPage + 1 < maxPagesToShow) {
    startPage = Math.max(1, endPage - maxPagesToShow + 1);
  }

  const makeBtn = (label, disabled, onClick, active = false) => {
    const b = document.createElement('button');
    b.textContent = label;
    if (disabled) b.disabled = true;
    if (active) b.classList.add('active');
    b.addEventListener('click', onClick);
    return b;
  };

  pagination.appendChild(makeBtn('Primeira', currentPage === 1, () => { currentPage = 1; renderGrid(currentPage); }));
  pagination.appendChild(makeBtn('Anterior', currentPage === 1, () => { if (currentPage > 1) { currentPage--; renderGrid(currentPage); } }));

  for (let i = startPage; i <= endPage; i++) {
    pagination.appendChild(makeBtn(String(i), false, () => { currentPage = i; renderGrid(currentPage); }, i === currentPage));
  }

  pagination.appendChild(makeBtn('Próxima', currentPage === totalPages, () => { if (currentPage < totalPages) { currentPage++; renderGrid(currentPage); } }));
  pagination.appendChild(makeBtn('Última', currentPage === totalPages, () => { currentPage = totalPages; renderGrid(currentPage); }));

  // 🔹 Atualiza o campo de pular página
  const pageJump = document.getElementById('pageJump');
  pageJump.innerHTML = `
    <span>Ir para página:</span>
    <input type="number" id="pageInput" min="1" max="${totalPages}" value="${currentPage}">
    <button id="goBtn">Ir</button>
  `;

  const pageInput = document.getElementById('pageInput');
  const goBtn = document.getElementById('goBtn');

  goBtn.addEventListener('click', () => {
    const pageNum = parseInt(pageInput.value);
    if (pageNum >= 1 && pageNum <= totalPages) {
      currentPage = pageNum;
      renderGrid(currentPage);
    } else {
      alert(`Número inválido! Digite entre 1 e ${totalPages}.`);
    }
  });

  // Também permite pressionar Enter
  pageInput.addEventListener('keydown', (e) => {
    if (e.key === 'Enter') goBtn.click();
  });
}



renderGrid(currentPage);
